import React from 'react';
import { RiFacebookBoxFill, RiInstagramFill, RiTwitterFill } from 'react-icons/ri'; // Importez le composant correctement
import './Navbar.css';
import logo from '../../assets/logo.png'; // Assurez-vous que le nom correspond au fichier réel

const Navbar = () => {
   return (
        <nav className='container '>
            <div className='tn_social'>
                {/* Assurez-vous de fournir une URL valide à l'attribut href */}
                <a href='https://www.facebook.com'><RiFacebookBoxFill/></a>
                <a href='https://www.instagram.com'><RiInstagramFill/></a>
                <a href='https://www.instagram.com'><RiTwitterFill/></a>
                <a href='https://www.instagram.com'><RiTwitterFill/></a>
            </div>
            <div className="navbar-logo">
                <img src={logo} alt="Logo" className='logo'/>
            </div>
            <ul className="navbar-links">
                <li>Faculté</li>
                <li>Départements</li>
                <li>Formations</li>
                <li>Espace Etudiant</li>
                <li>E-SERVICES</li>
                <li><button className='btn'>Contact us</button></li>
            </ul>
        </nav>
    );
}

export default Navbar;
